/** @jsxImportSource @emotion/react */
import { css } from '@emotion/react';

export const contactUsContainer = css({
    padding: '40px 0',
})

export const contactUsHeading = css({
    textAlign: 'center',
})

export const contactUsForm = css({
    maxWidth: 500,
    margin: 'auto',
    padding: '12px 24px',
    borderRadius: 12,
    '-webkit-box-shadow': '-1px 0px 21px 0px rgba(176,174,176,0.4)',
    'box-shadow': '-1px 0px 21px 0px rgba(176,174,176,0.4)',
})
